custom search between users in mongodb<p><strong>data</strong></p>

<pre><code>location:{
    type: String ,
    required: true
}
</code></pre>

<hr>

<p><strong>HTML register</strong></p>

<pre><code>&lt;label&gt;location*&lt;/label&gt;
&lt;select name="location" class="long" id="location"&gt;
    &lt;label class="optional"&gt;location&lt;/label&gt;
    &lt;option value="blah"&gt;blah&lt;/option&gt;
    &lt;option value="blahh"&gt;blahh&lt;/option&gt;
    &lt;option value="blahh"&gt;blahh&lt;/option&gt;
&lt;/select&gt;
</code></pre>

<p>I want the user to see other users profile(as suggestion) that in the same location so i add location select in register form 
So how can I pull his location from his database and put it as a condition in <code>find({})</code> </p>

<blockquote>
  <ul>
  <li>Is this possible ? </li>
  <li>Or is there any better or more practical way to do that ?</li>
  </ul>
</blockquote>

