How do I get the earliest record by date for a unique constraint?<p>I have a collection with two fields that are important to this question: a category and a date (I'll just use "yesterday" and "today" for simplicity).</p>

<pre><code>// Sample Data
{ category: 1, date: ISODate("yesterday") } 
{ category: 1, date: ISODate("today") }
{ category: 2, date: ISODate("yesterday") } 
{ category: 2, date: ISODate("today") }
{ category: 3, date: ISODate("yesterday") } 
</code></pre>

<p>Now, I'm modifying a query that would first query on the category then sort by date descending and limit to 1 result (giving me the earliest record by date for a single category.</p>

<pre><code>db.collection("things").find({ category: 1 }).sort({ date: -1 }).limit(1)

// Result
{ category: 1, date: ISODate("today") }
</code></pre>

<p>That worked great. However, I want the earliest record by for EVERY category. This means I can't use the limit operator (because I don't know how many categories there are at any given point in time) and I'm not guaranteed to have the date a record for every day for each category.</p>

<pre><code>// Expected Result
{ category: 1, date: ISODate("today") }
{ category: 2, date: ISODate("today") }
{ category: 3, date: ISODate("yesterday") } 
</code></pre>

<p>I've played with distinct, to no success.</p>

<p>How can I get the record with the earliest date for each category in a single query?</p>

