How to get records based on time?<p>I am new to MongoDb and would appreciate some help with this query. I wrote the following aggregation pipeline. I wrote a query which returns last 24 hours records after that I am getting (00:01) hour to (05:00) hour records. With this how can I get records between (20:00) hour and (23:59) hours. Anyone, please suggest me.</p>

<pre><code>db.collection.aggregate([
  {$match: {createDate: {$gte: new Date(new Date(ISODate().getTime() - 1000*60*60*24))}}},
  {
    $project: {
        hour:    { $hour: "$createDate" },
        minutes: { $minute: "$createDate" },
      }
  },
  { 
    $match: {
      $and: [{"hour": { "$gte" : 0}},{"minutes":{ "$gte" : 1}}],
      $and: [{"hour": { "$lte" : 5}}],
    }
  },
])
</code></pre>

<p>Output:</p>

<pre><code>{
  "hour" : 0
  "minutes" : 1
}

/* 2 */

{
  "hour" : 4
  "minutes" : 2
}
</code></pre>

<p>Expected output:</p>

<pre><code>{  
  "hour" : 0
  "minutes" : 1
}

/* 2 */

{
  "hour" : 4
  "minutes" : 2
},
{
  "hour" : 4
  "minutes" : 59
}
</code></pre>

<p>and</p>

<pre><code>{  
  "hour" : 20
  "minutes" : 1
}

/* 2 */

{
  "hour" : 22
  "minutes" : 2
},
{
  "hour" : 23
  "minutes" : 59
}
</code></pre>

